    /**
     * This function will test that the parse worked correctly AND it loaded everything into MongoDB in the correct way
     */
    @Test
    public void testParseAndLoad() throws ProcessTerminatedException {
        System.out.println("Running: edu.mayo.ve.VCFParser.VCFParserITCase.testParseAndLoad");
        String alias = "alias";
        String workspaceID = provision(alias);


        System.out.println("VCFParserITCase.Loading data into a new workspace...");
        VCFParser parser = new VCFParser();
        //false,false at the end of this call are correct for loading to MongoDB
        TypeAheadInterface thead = new TypeAheadCollection();
        parser.setReporting(reporting);
        parser.setTypeAhead(thead);
        parser.parse(VCF, workspaceID);  //put true in the second to last param for verbose load reporting

        //test that the metadata was loaded correctly
        System.out.println(parser.getMetadata().toString()); //workspace as it is in memory in the parser
        String resultMeta = (new MetaData()).getWorkspaceJSON(workspaceID); //workspace as it is saved in mongodb
        testMetaDataLoaded(parser.getMetadata().toString(), resultMeta);

        //test that the number of data rows is correct

        //check that the indexes are correct
        String indexedJson = (new Index()).getIndexes(workspaceID);
        DBObject indexeddbo = (DBObject) JSON.parse(indexedJson);
        BasicDBList fields = (BasicDBList) indexeddbo.get("fields");
        System.out.println(indexeddbo.toString());
        Set<String> actualKeys = new HashSet<String>();
        for(Object o : fields){
            DBObject next = (DBObject) o;
            //System.out.println(next);
            actualKeys.add((String)next.get("name"));
        }
        Set<String> expectedKeys = new HashSet<String>();
        expectedKeys.addAll(Arrays.asList("_id_",
                "FORMAT.GenotypePostitiveCount_1",
                "FORMAT.GenotypePositiveList_1",
                "INFO.SNPEFF_AMINO_ACID_LENGTH_1",
                "INFO.SNPEFF_TRANSCRIPT_ID_1",
                "INFO.SNPEFF_CODON_CHANGE_1",
                "INFO.SNPEFF_IMPACT_1",
                "INFO.SNPEFF_EXON_ID_1",
                "INFO.SNPEFF_GENE_NAME_1",
                "INFO.SNPEFF_AMINO_ACID_CHANGE_1",
                "INFO.SNPEFF_FUNCTIONAL_CLASS_1",
                "INFO.SNPEFF_EFFECT_1",
                "INFO.SNPEFF_GENE_BIOTYPE_1",
                "FORMAT.min.PL_1",
                "FORMAT.max.PL_1",
                "FORMAT.min.AD_1",
                "FORMAT.max.AD_1",
                "FORMAT.min.GT_1",
                "FORMAT.max.GT_1",
                "FORMAT.min.GQ_1",
                "FORMAT.max.GQ_1",
                "FORMAT.HeterozygousList_1",
                "FORMAT.HomozygousList_1",
                "CHROM_1",
                "_minBP_1",
                "_maxBP_1"
        ));
        assertEquals(expectedKeys.size(), actualKeys.size());
        for (String key: expectedKeys) {
            assertTrue(actualKeys.contains(key));
        }

        //other tests....

        //delete the workspace
        System.out.println("Deleting Workspace: " + workspaceID);
        Workspace wksp = new Workspace();
        wksp.deleteWorkspace(workspaceID);

    }

